import React from 'react';
import Meal from "./Meal/Meal";
import classes from './Meals.module.css';

/*
    * The component of the meal list
 */
const Meals = (props) => {
    return (
        <div className={classes.Meals}>
            {props.mealsData.map(item =>
                <Meal
                    key={item.id}
                    meal={item}
                    onAdd={props.onAdd}
                />
            )}
        </div>
    );
};

export default Meals;
